extern "C"
{
  extern void
  dgemv_( const char *trans, const int *m, const int *n,
          double const *alpha, double const *a, const int *lda,
          double const *x, const int *incx, double const *beta,
          double *y, const int *incy );

  extern void
  dgemm_( const char *transa, const char *transb, const int *m,
          const int *n, const int *k, double const *alpha,
          double const *a, const int *lda,
          double const *b, const int *ldb,
          double const *beta, double *c, const int *ldc );

  extern void
  dgetrf_( const int* m, const int* n, double* a, const int* lda,
           int* ipiv, int* info );

  extern void
  dgetri_( const int* n, double* a, const int* lda,
           int* ipiv, double* work, const int* lwork, int* info );

}


///////////////////////////////////////////////////////////////////////////
// computes the cross product of two vectors of length 3
///////////////////////////////////////////////////////////////////////////
static void cross3( double const * a, double const * b, double * axb )
{
  axb[0] = a[1]*b[2] - a[2]*b[1];
  axb[1] = b[0]*a[2] - a[0]*b[2];
  axb[2] = a[0]*b[1] - a[1]*b[0];
}
///////////////////////////////////////////////////////////////////////////
// computes the dot product of two vectors of length 3
///////////////////////////////////////////////////////////////////////////
static double dot3( double const * a, double const * b )
{
  return a[0]*b[0] + a[1]*b[1] + a[2]*b[2];
}


spcgrp::symops::symops( char const * inpname, char const * inplattice, int inpnumber, int inpnops, double const * begin, double const * end )
    : name(inpname), lattice(inplattice), number(inpnumber), nops(inpnops), lattice_code(0), data(begin,end), latvec(6,0), ucell(9,0), recip(9,0), invdata(inpnops*9,0), frcdata(inpnops*9,0)
{

  int N = 3;
  int LWORK = 64;
  std::vector<double> WORK( LWORK, 0 );
  std::vector<int> IPIV( 3, 0 );
  int INFO=0;
  for ( int iop=0; iop < nops; ++iop )
    {
       double * a = invdata.data() + iop*9;
       std::copy( data.data() + iop*12, data.data() + 9+iop*12, a );
       dgetrf_( &N, &N, a, &N, IPIV.data(), &INFO );
       dgetri_( &N, a, &N, IPIV.data(), WORK.data(), &LWORK, &INFO );
    };
}


void spcgrp::symops::SetLatVec( double a, double b, double c, double alp, double bet, double gam )
{
  latvec[0] = a;
  latvec[1] = b;
  latvec[2] = c;
  latvec[3] = alp;
  latvec[4] = bet;
  latvec[5] = gam;
  UpdateCell();
}


void spcgrp::symops::UpdateCell()
{
  double a = latvec[0];
  double b = latvec[1];
  double c = latvec[2];
  double alpha = latvec[3];
  double beta  = latvec[4];
  double gamma = latvec[5];

  double const D2R = M_PI / 180.;
  ucell[0+0*3] = a;
  ucell[1+0*3] = 0.;
  ucell[2+0*3] = 0.;
  ucell[0+1*3] = b*std::cos(D2R*gamma);
  ucell[1+1*3] = b*std::sin(D2R*gamma);
  ucell[2+1*3] = 0.;
  ucell[0+2*3] = c*std::cos(D2R*beta);
  ucell[1+2*3] = (b*c*std::cos(D2R*alpha)-ucell[0+2*3]*ucell[0+1*3])/ucell[1+1*3];
  ucell[2+2*3] = std::sqrt( c*c - ucell[0+2*3]*ucell[0+2*3] - ucell[1+2*3]*ucell[1+2*3] );

  std::fill( recip.data(), recip.data() + 9, 0. );
  cross3( ucell.data() + 3, ucell.data() + 6, recip.data() + 0 );
  cross3( ucell.data() + 6, ucell.data() + 0, recip.data() + 3 );
  cross3( ucell.data() + 0, ucell.data() + 3, recip.data() + 6 );
  double V = dot3( ucell.data() + 0, recip.data() + 0 );
  for ( int i=0; i<9; ++i ) recip[i] /= V;


  int N=3;
  double ALP=1.;
  double ZERO=0.;
  std::vector<double> WORK(9,0);
  double * w = WORK.data();
  
  for ( int iop=0; iop<nops; ++iop )
    {
       double * Ainv = invdata.data() + 9*iop;
       double * B    = frcdata.data() + 9*iop;
       dgemm_( "N", "T", &N, &N, &N, &ALP, Ainv,         &N, recip.data(), &N, &ZERO, w, &N );
       dgemm_( "N", "N", &N, &N, &N, &ALP, ucell.data(), &N, w,            &N, &ZERO, B, &N );
    }
/*
   dgemm_( "N", "T", &N, &N, &N, &ALP, ucell.data(), &N, recip.data(), &N, &ZERO, w, &N );

   std::printf("\n");
   for ( int i=0; i<3; ++i )
     std::printf("%20.10e %20.10e %20.10e\n",w[0+i*3],w[1+i*3],w[2+i*3]);
   std::printf("\n");
*/
}


double const * spcgrp::symops::GetLatVec() const
{
  return latvec.data();
}


std::vector<double> spcgrp::symops::GenAtomPositions( double const * crd, bool is_fractional ) const
{
  int const m = 3;
  int const inc = 1;
  double const alpha = 1.;
  double const zero = 0.;
  std::vector<double> ucrds;
  // convert to fractional coordinates
  double fcrd[3] = { crd[0], crd[1], crd[2] };
  if ( ! is_fractional )
    dgemv_( "T", &m, &m, &alpha, recip.data(), &m, crd, &inc, &zero, fcrd, &inc );

  // X = M.X+T+C
  for ( int iop=0; iop<nops; ++iop )
    {
      double const * A = data.data() + iop*12;
      double const * y = A + 9;
      double tcrd[3] = { y[0], y[1], y[2] };

      dgemv_( "N", &m, &m, &alpha, A, &m, fcrd, &inc, &alpha, tcrd, &inc );


      
      // check to see if it is unique
      bool close = false;
      int nat = ucrds.size()/3;
      for ( int a=0; a<nat; ++a )
        if ( ! close )
	  if ( std::abs( ucrds[0+a*3] - tcrd[0] ) < 0.0002 and
	       std::abs( ucrds[1+a*3] - tcrd[1] ) < 0.0002 and
	       std::abs( ucrds[2+a*3] - tcrd[2] ) < 0.0002 )
	    {
	      close = true;
	      break;
	    }
      if ( ! close )
        {
          ucrds.push_back( tcrd[0] );
          ucrds.push_back( tcrd[1] );
          ucrds.push_back( tcrd[2] );
        };
    };
  
  // convert to real-space coordinates
  int nat = ucrds.size()/3;
  for ( int a=0; a<nat; ++a )
    {
      double * c = ucrds.data()+a*3;
      dgemv_( "N", &m, &m, &alpha, ucell.data(), &m, c, &inc, &zero, fcrd, &inc );
      c[0] = fcrd[0];
      c[1] = fcrd[1];
      c[2] = fcrd[2];
    }
   return ucrds;
}



std::vector<double> spcgrp::symops::GenForceSymmetries( double const * crd, double const * frc, bool is_fractional ) const
{
  int const m = 3;
  int const inc = 1;
  double const alpha = 1.;
  double const zero = 0.;
  std::vector<double> ucrds;
  std::vector<double> frcs;
  // convert to fractional coordinates
  double fcrd[3] = { crd[0], crd[1], crd[2] };
  if ( ! is_fractional )
    dgemv_( "T", &m, &m, &alpha, recip.data(), &m, crd, &inc, &zero, fcrd, &inc );

  // X = M.X+T+C
  for ( int iop=0; iop<nops; ++iop )
    {
      double const * A = data.data() + iop*12;
      double const * y = A + 9;
      double tcrd[3] = { y[0], y[1], y[2] };

      dgemv_( "N", &m, &m, &alpha, A, &m, fcrd, &inc, &alpha, tcrd, &inc );

      // check to see if it is unique
      bool close = false;
      int nat = ucrds.size()/3;
      for ( int a=0; a<nat; ++a )
        if ( ! close )
	  if ( std::abs( ucrds[0+a*3] - tcrd[0] ) < 0.0002 and
	       std::abs( ucrds[1+a*3] - tcrd[1] ) < 0.0002 and
	       std::abs( ucrds[2+a*3] - tcrd[2] ) < 0.0002 )
	    {
	      close = true;
	      break;
	    }
      if ( ! close )
        {
          ucrds.push_back( tcrd[0] );
          ucrds.push_back( tcrd[1] );
          ucrds.push_back( tcrd[2] );
          tcrd[0] = frc[0];
          tcrd[1] = frc[1];
          tcrd[2] = frc[2];
          double gcrd[3] = {0.,0.,0.};
          dgemv_( "N", &m, &m, &alpha, frcdata.data()+9*iop, &m, tcrd, &inc, &zero, gcrd, &inc );
          frcs.push_back( gcrd[0] );
          frcs.push_back( gcrd[1] );
          frcs.push_back( gcrd[2] );
        };
    };
  
   return frcs;
}




spcgrp::triclinic::triclinic( char const * nname, int nnumber, int nnops, double const * begin, double const * end )
    : spcgrp::symops(nname,"triclinic",nnumber,nnops,begin,end)
{
    lattice_code=1;
    SetLatVec(100,101,102,103,104,105);
}

void spcgrp::triclinic::SetLatVec( double a, double b, double c, double alp, double bet, double gam )
{
  if ( std::abs(alp-90.) < 1.e-4 ) alp += 0.001;
  if ( std::abs(bet-90.) < 1.e-4 ) bet += 0.001;
  if ( std::abs(gam-90.) < 1.e-4 ) gam += 0.001;

  latvec[0] = a;
  latvec[1] = b;
  latvec[2] = c;
  latvec[3] = alp; // != 90
  latvec[4] = bet; // != 90
  latvec[5] = gam; // != 90
  UpdateCell();
}

spcgrp::monoclinic::monoclinic( char const * nname, int nnumber, int nnops, double const * begin, double const * end )
    : spcgrp::symops(nname,"monoclinic",nnumber,nnops,begin,end)
{
    lattice_code=2;
    SetLatVec(100,101,102,103,104,105);
}

void spcgrp::monoclinic::SetLatVec( double a, double b, double c, double, double bet, double )
{
  if ( std::abs(bet-90.) < 1.e-4 ) bet += 0.001;

  latvec[0] = a;
  latvec[1] = b;
  latvec[2] = c;
  latvec[3] = 90;
  latvec[4] = bet;
  latvec[5] = 90;
  UpdateCell();
}

spcgrp::orthorhombic::orthorhombic( char const * nname, int nnumber, int nnops, double const * begin, double const * end )
    : spcgrp::symops(nname,"orthorhombic",nnumber,nnops,begin,end)
{
    lattice_code=3;
    SetLatVec(100,101,102,103,104,105);
}

void spcgrp::orthorhombic::SetLatVec( double a, double b, double c, double, double, double )
{
  if ( std::abs(a-b) < 1.e-4 ) b += 0.001;
  if ( std::abs(a-c) < 1.e-4 ) c += 0.002;

  latvec[0] = a;
  latvec[1] = b;
  latvec[2] = c;
  latvec[3] = 90;
  latvec[4] = 90;
  latvec[5] = 90;
  UpdateCell();
}

